const generalSansBase64 = ""; // Replace with actual base64 data
const generalSansBoldBase64 = ""
window.generateAndDownloadPDF = async function(jsonData) {

  const pdf = new window.jspdf.jsPDF();
  pdf.addFileToVFS('GeneralSans-Regular.ttf', generalSansBase64);
  pdf.addFont('GeneralSans-Regular.ttf', 'GeneralSans', 'normal');

  pdf.addFileToVFS('GeneralSans-Semibold.ttf', generalSansBoldBase64);
  pdf.addFont('GeneralSans-Semibold.ttf', 'GeneralSans', 'bold');

  const pageWidth = pdf.internal.pageSize.getWidth();
  const pageHeight = pdf.internal.pageSize.getHeight();
  let yOffset = 24;


  pdf.setFont('GeneralSans', 'bold');

  pdf.setFontSize(18);

  pdf.text('Insights Report', pageWidth / 2, yOffset, { align: 'center' });
  yOffset += 20;

  pdf.setFont('GeneralSans', 'normal');
  pdf.setFontSize(12);
  for (let key in jsonData) {

    const value = jsonData[key].toString();
    const lines = pdf.splitTextToSize(value, 180); 

    lines.forEach(line => {
      // Check if the next line will exceed the page height
      if (yOffset + 7 > pageHeight) { // 10 is the height of each line in mm
        pdf.addPage(); // Add a new page
        yOffset = 20; // Reset vertical position for the new page
      }
      pdf.text(line, 20, yOffset); // Add text to PDF
      yOffset += 7; // Move down for the next line
    });
  }

  pdf.save('report.pdf');
};